import React from 'react';
import Tilt from 'react-tilt';
import './Logo.css';
import brain from './brain.png';

const Logo = () => {
    return (
        <div className='ma4 mt0'>

            <div className="Tilt-inner pa3"> <img className="mt4" style={{ paddingTop:'5px'}}alt='logo' src={brain}></img> 
            </div>

        </div>
    )
}


export default Logo;
